pragma solidity 0.4.19;

import "./MockContract.sol";


contract MockTokenTransferProxy is MockContract {
    function transferFrom(
        address _token,
        address _from,
        address _to,
        uint _amount
    )
        public
        returns (bool _success)
    {
        functionCalledWithArgs("transferFrom", keccak256(
            _token,
            _from,
            _to,
            _amount
        ));

        return true;
    }

    function wasTransferFromCalledWith(
        address _token,
        address _from,
        address _to,
        uint _amount
    )
        public
        view
        returns (bool _wasCalled)
    {
        return wasFunctionCalledWithArgs("transferFrom", keccak256(
            _token,
            _from,
            _to,
            _amount
        ));
    }

    function getFunctionList()
        internal
        returns (string[10] functionNames)
    {
        return ["transferFrom", "", "", "", "", "", "", "", "", ""];
    }
}
